import React from 'react';
import { NavLink } from 'react-router-dom';
import './styles.css'; // добавляем CSS файл

function Courses() {
  return (
    <div className="container"> 
      <NavLink to='/javascript' className="card"> 
        <div className="content">
          <p>JavaScript ES5/ES6</p>
        </div>
      </NavLink>

      <NavLink to='/html' className="card"> 
        <div className="content">
          <p>HTML</p>
        </div>
      </NavLink>

      <NavLink to='/reactjs' className="card"> 
        <div className="content">
          <p>ReactJS</p>
        </div>
      </NavLink>
    </div>
  );
}

export default Courses;
